class Solution:
    def removeAnagrams(self, words: List[str]) -> List[str]:
        result = []
        for word in words:
            temp_word = word
            while True:
                for prev_word in result:
                    if sorted(temp_word) == sorted(prev_word):
                        temp_word = ''
                        break
                else:
                    break
            if temp_word:
                result.append(temp_word)
        return result
